import React, { Component } from "react";
import usericon from "../img/nav_usericon.png";

class Navbar extends Component {
  state = {
    logo: usericon,
    usericon: "",
    username: "",
    mail: "",
  };

  render() {
    return (
      <div className="nav">
        <div className="logo">
            
        </div>
        <div className="user-details">
          <img src={this.state.logo} className="nav-logo" />
        </div>
      </div>
    );
  }
}

export default Navbar;
